import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { CurrDataService } from './curr-data.service';
import { host } from './host';

@Component({
  selector: 'app-main',
  templateUrl: './main.component.html',
  styleUrls: ['./main.component.css']
})
export class MainComponent implements OnInit {

  constructor(
    private httpClient: HttpClient,
    private currDataServ: CurrDataService
  ){}

  async ngOnInit()
  {
    const data: UrlData = this.currDataServ.getUrlData();
    const res = this.httpClient.get(`${host}/sezon/${data.season}/${data.group}`).subscribe((e) => {
      console.log(e);
    })
  }
}

export interface UrlData{
  season: string,
  group: string;
}
